import React from "react";
import Todo from "./components/1_JustJS/component/Modal";
import Expenses from "./components/3-4_ChartExpense/Expense/Expenses";
import './style.css';

const App = () => {
  const expenses = [
    {
      id: "e1",
      title: "Toilet Paper",
      amount: 94.12,
      date: new Date(2020, 7, 14),
    },
    {
      id: "e2",
      title: "New TV",
      amount: 799.49,
      date: new Date(2021, 2, 12),
    },
    {
      id: "e3",
      title: "Car Insurance",
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: "e4",
      title: "New Desk (Wooden)",
      amount: 450,
      date: new Date(2021, 5, 12),
    },
  ];

  return (
    <div>
      <h1>My Todos</h1>
      <Todo text='Learn React' />
      <Todo text='섹션 1 학습' />
      <h2>Let's get started!</h2>
      {/* <Expenses items={expenses} /> */}
    </div>
  );
}
export default App;
